import ExpenseItem from "./ExpenseItem";
function Expenses(props) {
  <div>
    <ExpenseItem
      title={[0].title}
      amount={[0].amount}
      date={[0].date}
    ></ExpenseItem>
    <ExpenseItem
      title={[1].title}
      amount={[1].amount}
      date={[1].date}
    ></ExpenseItem>
    <ExpenseItem
      title={[2].title}
      amount={[2].amount}
      date={[2].date}
    ></ExpenseItem>
    <ExpenseItem
      title={[3].title}
      amount={[3].amount}
      date={[3].date}
    ></ExpenseItem>
  </div>;
}

export default Expenses;
